<app-page [busy]="busy">

  <app-page-header>Enrollee Profile History</app-page-header>

  <app-enrollee-review [isEnrollee]="false"
                       [enrolment]="enrolmentProfileHistory?.profileSnapshot"></app-enrollee-review>

  <div class="row justify-content-between">
    <div class="col pt-4">

      <button mat-stroked-button
              type="button"
              (click)="routeTo()">Back</button>

    </div>
  </div>

</app-page>
